import React from 'react';
import { Link } from 'react-router-dom';
import './style.css';

const Login = () => {
    return (
        <div className="login-container">
            <div className="login-form">
                <h2 style={{ textAlign: 'center', color: '#0f4c75' }}>LEE EUNJI</h2>

                <label htmlFor="username">Username</label>
                <input type="text" id="username" placeholder="아이디를 입력하세요." required />

                <label htmlFor="password">Password</label>
                <input type="password" id="password" placeholder="비밀번호를 입력하세요." required />

                <div className="stay-logged-in"> 
                    <input type="checkbox" id="stayLoggedIn" /> 
                    <label htmlFor="stayLoggedIn">로그인 상태 유지</label> 
                </div>
              
                <button type="submit">Log In</button>
            </div>

            <div className="login-links">
                <Link to = "/FindId" className="login-link">아이디찾기</Link>
                <Link to = "/FindPw" className="login-link">비밀번호찾기</Link>
                <Link to="/register" className="login-link">회원가입</Link>
            </div>
        </div>
    );
};

export default Login;
